        this.state = {rows : []}
        this.Add_workspaces.bind(this);
    }

    Add_workspaces = () =>{
        let new_row = this.state.rows;
        new_row.push(this.Aria);
        this.setState(
            { rows : new_row }
        );
    }

    Aria = () => {
        return(
       <div className="aria">
