            </div>
            <div className = "global-responses">
                <a>add a responce</a>
            </div>
       </div> 
        );
    }



    render(){
        this.Add_workspaces();
        let rows = [this.Aria];
        return(
            <>
            {rows.map((Row) => <Row></Row>)}
            </>
        );
    }


}

export default Workspaces;
